import React, { Component } from 'react';
import TextField from '@material-ui/core/TextField';

class OnermEntry extends Component {
    render() { 

        var inputStyle = {
            position: 'fixed',
            width: '50%',
            justifyContent:'center'
        }

        return (
        <div style={inputStyle}>

        <form noValidate autoComplete="off">
        <TextField id="OneRM" label="Enter One Rep Max" variant="outlined" />
        </form>

        </div> );
    }
}
 
export default OnermEntry;
